import { useState } from "react";

// If you don't have these UI components, use basic HTML/button/divs or your own Card/Button/Switch implementations
// import { Button } from "@/components/ui/button";
// import { Card, CardContent } from "@/components/ui/card";
// import { Switch } from "@/components/ui/switch";

function Button({ children, className = '', variant, ...props }) {
  let base = "px-4 py-2 rounded font-semibold transition ";
  if (variant === "outline") base += "border border-gray-600 bg-transparent text-white hover:bg-gray-800 ";
  if (variant === "ghost") base += "bg-transparent text-gray-400 hover:bg-gray-800 ";
  return <button className={base + className} {...props}>{children}</button>;
}
function Card({ children, className = "", ...props }) {
  return <div className={"rounded-lg shadow " + className} {...props}>{children}</div>;
}
function CardContent({ children, className = "", ...props }) {
  return <div className={className} {...props}>{children}</div>;
}
function Switch({ checked, onCheckedChange }) {
  return (
    <button
      className={`w-10 h-6 rounded-full border-2 border-gray-600 flex items-center transition bg-gray-800 ${checked ? 'bg-green-500 border-green-500' : ''}`}
      onClick={() => onCheckedChange(!checked)}
      aria-checked={checked}
      role="switch"
    >
      <span className={`inline-block w-4 h-4 rounded-full bg-white shadow transform transition ${checked ? 'translate-x-4' : 'translate-x-0'}`}></span>
    </button>
  );
}

export default function BuilderTab() {
  const [isLive, setIsLive] = useState(true);

  return (
    <div className="min-h-screen bg-[#0b0b0b] text-white px-6 py-4">
      {/* Header */}
      <div className="flex justify-between items-center mb-6">
        <div className="text-2xl font-bold">Memescope OG</div>
        <div className="space-x-3">
          <Button variant="outline">Save Draft</Button>
          <Button className="bg-green-500 hover:bg-green-400 text-black">Publish Flow</Button>
        </div>
      </div>

      {/* Main Layout */}
      <div className="grid grid-cols-12 gap-4">
        {/* Logic Blocks */}
        <div className="col-span-3 bg-[#151515] rounded-xl p-4">
          <h2 className="text-lg font-semibold mb-4">Logic Blocks</h2>
          <div className="space-y-2">
            <Card className="bg-[#1e1e1e] hover:bg-[#2a2a2a] cursor-pointer">Smart Wallet Buys (10m)</Card>
            <Card className="bg-[#1e1e1e] hover:bg-[#2a2a2a] cursor-pointer">Volume Spike &gt; X%</Card>
            <Card className="bg-[#1e1e1e] hover:bg-[#2a2a2a] cursor-pointer">Exclude Exit Liquidity</Card>
            <Card className="bg-[#1e1e1e] hover:bg-[#2a2a2a] cursor-pointer">Tag: Meme</Card>
            <Card className="bg-[#1e1e1e] hover:bg-[#2a2a2a] cursor-pointer">Tag: GambleFi</Card>
          </div>
        </div>

        {/* Strategy Flow Canvas */}
        <div className="col-span-6 bg-[#121212] rounded-xl p-4 border border-neutral-700 min-h-[400px]">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-lg font-semibold">Strategy Flow</h2>
            <Button variant="ghost" size="sm">Clear All</Button>
          </div>
          <div className="space-y-2">
            <Card className="bg-[#222] border border-purple-500">Tag: Meme</Card>
            <Card className="bg-[#222] border border-purple-500">Tag: GambleFi</Card>
            <Card className="bg-[#222] border border-purple-500">Smart Wallet Buys &gt; 3 in last 10m</Card>
            <Card className="bg-[#222] border border-purple-500">Volume Spike &gt; 30%</Card>
          </div>
          <div className="mt-4 text-sm text-gray-400 italic">
            Strategy: Tokens with Meme + GambleFi tags AND Smart Buys &gt; 3 in last 10m AND Volume Spike &gt; 30%
          </div>
        </div>

        {/* Live Token Preview */}
        <div className="col-span-3 bg-[#151515] rounded-xl p-4">
          <div className="flex justify-between items-center mb-4">
            <h2 className="text-lg font-semibold">Live Token Preview</h2>
            <div className="flex items-center gap-2">
              <span className="text-sm">LIVE</span>
              <Switch checked={isLive} onCheckedChange={setIsLive} />
            </div>
          </div>
          <Card className="bg-[#1e1e1e] mb-3">
            <CardContent className="p-3">
              <div className="flex justify-between items-center">
                <div>
                  <div className="font-semibold">$PAWPAW</div>
                  <div className="text-xs text-gray-400">GambleFi • Meme • Low Risk</div>
                </div>
                <div className="text-green-400 font-semibold">+24%</div>
              </div>
            </CardContent>
          </Card>
          <Card className="bg-[#1e1e1e]">
            <CardContent className="p-3">
              <div className="flex justify-between items-center">
                <div>
                  <div className="font-semibold">$BABY BOB</div>
                  <div className="text-xs text-gray-400">GambleFi • Meme • Low Risk</div>
                </div>
                <div className="text-green-400 font-semibold">+34%</div>
              </div>
            </CardContent>
          </Card>
        </div>
      </div>
    </div>
  );
}
